import React, {useState} from 'react';
import {BrowserRouter as Router} from 'react-router-dom';
import Navigation from './components/Navigation';
import LoggedRouter from "./components/LoggedRouter";
import UnLoggedRouter from "./components/UnLoggedRouter";
import axios from 'axios';
import { Provider } from 'react-redux';
import store from './redux/store';
import { connect } from 'react-redux';
const accessToken = localStorage.getItem('accessToken') || '';
const isLogged = localStorage.getItem('isLogged') || 'false';

// Setting baseURL
axios.defaults.baseURL = 'http://localhost:8080';

const mapStateToProps = (state) => {
  return {
    isLogged: state.isLogged,
  };
};

const App = () => {
  return (
      <Provider store={store}>
        <Router >
          <Navigation accessToken={accessToken}/>
            {isLogged && <LoggedRouter accessToken={accessToken}/>}
            {!isLogged && <UnLoggedRouter/>}
        </Router>
      </Provider>
  );
};

export default App;
